import styled from "styled-components";

export const AllProductsDiv = styled.div`
  width: 100%;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;


  div#products{
      display:flex;
      flex-wrap:wrap;
  }
  div#products{
    display:flex;
    flex-direction-column;
    margin-top:5%;

}
`;
